import React from 'react';
import Link from 'next/link';

const indexPage = () => {
    return (
        <div>
            <h1>The Main Page</h1>
            <h3><Link href="/authPage">Go to Auth page</Link></h3>
        </div>
    )
}

export default indexPage;
